I feel like I’ve been waiting for this movie forever. While I’m sure plenty of us wish we could have seen this cool story on the big screen, I’m glad it’s finally released.✨
_
Real talk, I wasn’t a Disney kid growing up. I was the annoying younger sister who wanted to do the stuff my older brother did, so I was really into Pokémon and anime and PC games and LOTR. 😂 If you can’t tell I was firmly an indoor kid, lol. But my neighbor around age 11-18 was a Disney kid and introduced me to a lot of the movies I had missed out on. Her favorite was Mulan, because she (an Asian-American) was overjoyed to see positive Asian representation from a big company like Disney. She was really excited to have her own Disney princess to dress as for Halloween. 

So shoutout to my old pal Kim, if somehow you are reading this from the wide world of the internet, I hope you enjoy the new Mulan as much as the animated Mulan!💜💜💜
